import React from 'react';
import api from './services/api';
import Header from './components/Header';
import Main from './pages/main';
import Routes from './routes';

import './styles.css';

const App = () => (
  <div className="App">
    <Header />
    <Main />
    <Routes />
  </div>
)

export default App;
